INSERT INTO `adds` VALUES (1,0,1,2,1125,0,'Walk In Interview For Sales Manager : Bangalore','','',' Job Description\r\nBusiness Results:\r\no Selling of Life insurance products through internal channel partner in order to meet sales targets\r\no Responsible for sales figures\r\no Updating & sending sales reports on a daily basis. (Reports on Client meetings, business etc.)\r\no Enabling and ensuring the success of sales activities/campaigns for channels.\r\n\r\nTraining:\r\no Maintaining good product knowledge about competition\r\no Training on sales process and basic underwriting  Product Training, Basic Sales Training, Objection Handling\r\no Ensure KYC and 100% compliance is followed\r\n\r\nRelationship management:\r\no Ensuring a healthy relationship with the clients and channel partners\r\n\r\nWalkin between 0900hrs to 1200hrs on 4th, 5th and 7th Mar 2015.\r\n\r\nTo Meet : Vikram Ramakrishna\r\n\r\nVenue: Edelweiss Broking Ltd, No.3/2 & 4/3, 3rd Floor, S M Towers, 11th Main Road, Jayanagar 3rd Block, Bangalore - 560011\r\n\r\nCTC 3LPA Fixed + 3000pm (Reimbursement)\r\n',0,'N','2015-02-28 06:37:10','0000-00-00 00:00:00','Indivisual','Edelweiss Tokio Life Insurance Ltd','hr@edelweisstokio.in','9686662421',0,'Y','N','2015-02-28 11:37:10','2015-02-28 11:37:10'),(2,0,1,2,1042,0,'Wipro | MEGA Walk-in for Finance & Accounts | 2nd & 3rd March 2015','','','WIPRO HIRING FOR  Finance & Accounts\r\n \r\nMention **SONAM** on top of your CV\r\n \r\n***** SKILLS ******\r\n* Excellent knowledge of Indian Accouting/ GL Accounting\r\n* Minimum 1 year of experience in Finance & Accounts domain\r\n* Excellent skills in MS office especially EXCEL\r\n* Good Analytical Skill\r\n* Good communication skills\r\n \r\n******QUALIFICATION REQUIRED******\r\nCommerce Graduate / Regular Post Graduate / ICWA Inter / CA Inter (WRE) / MBA\r\n \r\n******BENEFITS******\r\n- Chances to move into Wipro technologies or other division of wipro after 18 months through internal job postings.\r\n- 5 Days Working\r\n- HUGE Incentives\r\n- Free cab\r\n- Internet facility, ATM facility\r\n- Food Court\r\n- Excellent Growth Path\r\n- Medical facility\r\n \r\n******ELIGIBILITY CRITERIA******\r\n1) Should be above 18 years and below 45 years of age.\r\n2) Should be comfortable working 24*7 including night shifts.\r\n3) Should have excellent communication skills.\r\n \r\nINTERVIEW DATE - 2nd & 3rd March 2015\r\n \r\nINTERVIEW VENUE\r\nA-29, Mohan Cooperative Industrial Estate, Mathura Road, Delhi 110044\r\n(5 mins walking distance from Mohan Estate Metro Station)\r\n \r\nTime - 11 AM to 2 PM\r\n \r\nContact Person- Sonam Dhawan\r\n \r\nFor further queries please call : 8860606923',0,'N','2015-02-28 06:42:03','0000-00-00 00:00:00','Indivisual','Sonam','hr@wipro.com','8860606923',0,'Y','N','2015-02-28 11:42:03','2015-02-28 11:42:03'),(3,0,1,1,1209,0,'Fresher Mechanical or Chemical Engineer','','','Job Description Send me Jobs like this\r\ncompany located in western mumbai area looking for Engg. degree holders for project work\r\n\r\ncall for details\r\n02265673330\r\n02265569131\r\n7498338936\r\njobhost1234@gmail.com\r\nSalary: Less Than 50,000 - 1,50,000 P.A\r\nIndustry:Chemicals / PetroChemical / Plastic / Rubber\r\nFunctional Area:Production , Manufacturing , Maintenance\r\nRole Category:Other\r\nRole:Fresher',0,'N','2015-03-03 07:09:43','0000-00-00 00:00:00','Indivisual','Mr. Alpesh','info@siddhivinayakconsultancy.net','9374499107',0,'Y','N','2015-03-03 12:09:43','2015-03-03 12:09:43'),(4,0,1,1,1209,0,'jobs for Mechanical Engineer','','','Company- A well known automobile company\r\nProfile- Production Engineer\r\nNeed- B.Tech/B.E. mechanical/Automobile/Production\r\nExperience- 0-2year\r\nProcess- Immidiate joining after Interview\r\nSalary: Not Disclosed by Recruiter\r\nIndustry:Automobile / Auto Anciliary / Auto Components\r\nFunctional Area:Production , Manufacturing , Maintenance\r\nRole Category:Other\r\nRole:Fresher\r\nKeyskills',0,'N','2015-03-03 07:22:15','0000-