ment, home appliances and oil and gas exploration. With 14,000 employees worldwide, the corporation\'s annual sales are approximately $2.3 billion, with nearly half from sales outside the United States. Kennametal is headquartered in Latrobe, Pa., USA, and has been named one of the Best Places to Work in Pennsylvania. Kennametal is represented in more than 60 countries. Kennametal operations in Europe are headquartered in Furth, Germany. Kennametal Asia Pacific is headquartered in Singapore. Kennametal Shared Services, Bangalore, India Global Information Technology Global IT Services group in Bangalore supports and services Kennametal Business units around the world. The prime responsibility is to service and support Kennametal plant locations, sales offices and other business operations within the Asia Pacific rim. Services include business systems support, application development, project deployment, network services and support, hardware support, package deployment, voice and data performance services, Engineering Systems services and system deployment. The Global IT Services group operates on a 24x7 schedule in support and services to the Kennametal user base around the world besides supporting peer groups stationed in Europe and North America.\r\nDesignation	IT Helpdesk (voice Support) - Walk in Interview on 11th April 2015\r\nJob Description	\r\nWalk in for an interview on 11th April 2015 b/w 10.00 am to 4 pm for opening in IT Helpdesk (Voice support)\r\n\r\nVenue : M/s. Kennametal Shared Services Pvt Ltd, ITPL, Whitefield, Unit 3,4,5 & 6, 5th Floor, Navigator Block, Bangalore-560066. Ph : 080 40238400 (Land mark : 500 Meters ahead of Shantiniketan towards Hope Farm)\r\n\r\nPlease carry print of the mail along with your CV.  Also carry Original ID Proof such as PAN Card / Driving License/Aadhar Card to submit at ITPL Security Gate.\r\n\r\nJob Responsibilities :\r\n\r\nInitial and primary contact point for all internal employees for all Information Technology related requests regarding approved software and hardware. \r\n\r\nProvide support for requests submitted via phone, email, fax, Service Now tickets, and walk-ins. \r\n\r\nResponsible for resolving all first level requests and where possible, second level requests. \r\n\r\nAdditionally, responsible for logging, monitoring, and updating service requests tickets, and providing periodic updates to the requestor and ensure that the best possible customer service is provided. \r\n\r\nUnder general direction, provides support to end-users for PC, Server, Applications, WAN / LAN Networking and all other IT / IS services. \r\n\r\nInterfaces with PC, Operations, Network services, Software support, application support, and other service providers to restore service and / or identify and correct core problem and issues. \r\n\r\nReview Service Now Tickets entered by the GSC to identify common problems that could be solved by the requestor and create Helpful Hints for self-serve user resolution.\r\nDesired Profile	\r\n- Must be a Graduate from Reputed University\r\n\r\n- Must have International Technical voice support experience\r\n\r\n- Must possess excellent communication in English\r\n\r\n- Must have clear documents with respect to Education and Experience\r\n\r\n- Must be willing to work in Rotational shifts (24/7 shift)\r\n\r\nExperience	1 - 5 Years\r\nIndustry Type	IT-Software / Software Services\r\nRole	Associate/Senior Associate -(Technical)\r\nFunctional Area	ITES, BPO, KPO, LPO, Customer Service, Operations\r\nEducation	\r\nUG - Any Graduate - Any Specialization\r\n\r\nPG - Post Graduation Not Required\r\n\r\nDoctorate - Doctorate Not Required\r\n\r\nCompensation:	 Not disclosed\r\nLocation	Bengaluru/Bangalore\r\nKeywords	It Helpdesk Voice Support Application Support Technical Support\r\nContact	Kennametal Shared Services Pvt Ltd \r\nWhitefield, \r\nBANGALORE,Karnataka,India 560066\r\nTelephone	91-80-40230400\r\nWebsite	https://www.kennametal.com',0,'N','2015-04-21 07:2