ails \r\n2. Mandatory documents to be carried \r\n3. Eligibility criteria and contact information \r\n== === = ==== = == === ==== ==== === ===== ====== ===== == ==== ======  ===== == ==  ==== === == ==== ====== =\r\n\r\n1. Interview Details \r\n\r\nSkill :- Mainframe(CICS)\r\n \r\nJoining Location: Kolkata\r\n \r\nExperience :- 3 - 6  yrs\r\n\r\nJob Description :- Should have good experience in CICS for Mainframe. Good exposure in DB2 application\r\n\r\n \r\nDate : 08th May, 2015\r\n\r\nTime : 10:00 AM to 1:30 PM\r\n\r\nInterview Venue :  Tata Consultancy Services, Building 1B,Ecospace\r\nPlot - IIF/12,New Town, Rajarhat,\r\nKolkata - 700156,West Bengal\r\nIndia\r\n\r\nPoint of Contact : HR\r\n= ==== ==== ===  =====  === === ==  === =====  === === ====  ====  === == ====  ====== ==  ===== =====  ==== ==== ==== ==== ==  = ======\r\n\r\n2. Mandatory Documents \r\nPlease ensure to carry an original and photocopy of all the documents listed below. In the absence of below documents we will not be able to proceed with your interview.\r\ni. TCS Online Application Form \r\nii. Updated Resume \r\niii. One Photograph (passport size)\r\niv. Original and Copy of the below mentioned documents:\r\nGovernment Photo ID Proof ( PAN Card Mandatory  /  Driving License  /  Passport ) \r\nClass 10 Mark-Sheet & Passing Certificate\r\nClass 12 Mark-Sheet & Passing Certificate\r\nUG Mark-Sheets & Degree Passing Certificate \r\nPG Mark-Sheets & Degree Passing Certificate\r\nAppointment letter for current organization, mentioning the date of joining.\r\nLatest Compensation Letter \r\nRelieving Letter for Current Company ( if applicable) \r\nExperience /  Service Certificates for all previous employment clearly mentioning the Joining & Release dates\r\nLatest Compensation Letter \r\nLast 3 months pay-slip \r\nRelieving Letter for Current Company (if applicable).\r\nExperience / Service Certificates for all previous employment clearly mentioning the Joining & Release dates \r\n=== ==== ==== ===== ====== =====  ===== ===== ====== === ====== === ==== ======= ======= ======= ====\r\n3. Eligibility Criteria \r\nBE/ B.Tech/ MCA/ M.Sc/ MS with minimum 3 years of relevant experience post Qualification IT- Experience. \r\nBSc Graduates with minimum 3.5 years of relevant experience post qualification IT Experience. \r\nOnly Full Time courses would be considered. \r\nConsistent academic records Class X onwards (Minimum 50% aggregate - Refer section below for guidelines) \r\nCandidate who have been rejected in a TCS interview in the last 6 months need not apply.\r\nNote: \r\n==== === ==== == ==  === == ==== ====  == === == ===  ===== === === === =====  == ===== === ====  === == === == ===\r\n*Steps for Profile Creation \r\n1. Visit http://www.careers.tcs.com\r\n2. Click on the Experienced Professionals Link\r\n3. Create New Profile (select Area of Interest as IT & Fill details and upload your resume)\r\n4. Receive EP Reference NO. on registered email and login to our portal\r\n5. Fill Online Application Form\r\nPlease fill in the TCS online application form and carry a copy with you on the day of interview to experience a quicker interview process. \r\nIf you already have a profile in TCS career portal and have an EP number, please ensure that the CV and Application form are properly uploaded, before appearing for interview. \r\nRequest you to please fill in the required details in the Application Form only after referring your relevant documents because the details which you enter in the form will be used for your Background Check Process post offer from TCS. \r\nAll subjects mentioned on the mark sheets should be taken into consideration for calculating the aggregate marks. All optional /additional subjects to be included (Irrespective of any University / Education Board Norms). Do not use any concept of Best of 5/6 or Additional Marks etc. \r\nIn case of Graduation and Post-Graduation, aggregate marks should be calculated after taking into consideration Honors as well as Pass subjects also. \r\nPlease Do Not carry any Electronic Media items (Laptops, CD, Pen drives, mass storage devices, etc. ) during the interview process in TCS premise. \r\nWe would look forward to seeing you at the venue. \r\nPlease acknowledge this mail and confirm your availability. \r\nIn case you are not able to attend, please inform us at least 48 hours prior to the interview.  \r\nThe interview process would be a day long activity. Request you to plan your schedule accordingly. \r\nFor queries you may connect with our Toll Free Helpline Number (1800-209-3111). \r\nWishing you a Successful Career. \r\n\r\nThanks & Regards\r\nHR Talent Acquisition Group \r\nTata Consultancy Services\r\n\r\n\r\nSalary: Not Disclosed by Recruiter\r\nIndustry: IT-Software / Software Services\r\nFunctional Area: IT Software - Application Programming, Maintenance\r\nRole Category: Software Developer\r\nRole: Software Developer\r\nKeyskills: Mainframe CICS\r\nDesired Profile\r\n\r\nEducation:UG -Any Graduate - Any Specialization \r\nPG - Any Postgraduate - Any Specialization \r\nDoctorate - Doctorate Not Required\r\nCompany Profile\r\nTata Consultancy Services Ltd.\r\nContact Details\r\nRecruiter Name:Niladri Mukherjee\r\nContact Company:Tata Consultancy Services Ltd\r\nTelephone:Not Mentioned\r\nEmail :niladri.m12@tcs.com',0,'N','2015-05-08 05:44:33','0000-00-00 00:00:00','Indivisual','niladri','niladri.m12@tcs.com','18002093111',0,'Y','N','2015-05-08 09:44:33','2015-05-08 09:44:33'),(39,0,1,2,1444,0,'Shaadi.com - Walk in Interviews - Kolkata ','imagesjpg_1_2_0_554ca94f66860.jpg,','14004,','Shaadi.com - Walk in Interviews - Kolkata \r\nShaadi.com - Kolkata, West Bengal\r\nJob Description\r\n\r\nSend me Jobs like this\r\nDON\"T MISS AN OPPORTUNITY TO WORK WITH CORPORATE !!!!!!!!!!!!!!\r\nWalk in interview:\r\n1.Product Advisor - Market Development (Exp 0 - 2 years)\r\n* Making outbound calls to Shaadi.com Members offering assistance and up selling.\r\n* Handling telephonic and Walk-in Inquiries at the center\r\n* Following the defined sales process to convert Inquiries into membership.\r\n* Meeting Sales and conversion Targets\r\nVery good at communication skills.\r\nPriror experience in Sales or Service will be an added advantage.\r\nNO COLD CALLING!! NO FIELD SALES!!\r\n*Attractive Salary plus Incentives*\r\nLocation : Kolkata (Chetla & Howrah)\r\nDate : 6th to 15th May 2015\r\nTime : 11:00 am to 6:00 pm\r\nVenue Details:\r\nVenue1:\r\nPeople Interactive (I) Pvt. Ltd.\r\n25,Chetla Central Road,\r\nOpposite Chetla Central Park,\r\nKolkata 700027.\r\nContact Person: Beauty Ghosh (08017183363)\r\n\r\nVenue 2:\r\nPeople Interactive (I) Pvt. Ltd.\r\n22/23/1, 1st Floor, Paul Villa, N.S.Road,\r\nHowrah Maidan,\r\nHowrah 1.\r\nContact Person: Gulrose Aslam (09836723340)\r\n\r\nRequired experience:\r\n\r\nSales, Telesales, Counselling, Telecalling: 1 year',0,'N','2015-05-08 05:47:20','0000-00-00 00:00:00','Indivisual','Beauty Ghosh','hr@shadi.com','9836723340',0,'Y','N','2015-05-08 09:47:20','2015-05-08 09:47:20'),(40,0,1,1,1444,0,'Daily Walk In for Catia Design Engineers','catiajpg_1_1_0_554caa893cfad.jpg,','16588,','Job Description Send me Jobs like this\r\nMust be Engineering Graduate in Mechanical Engineering / Diploma Holder with 3-4 years of experience\r\nGood experience in CATIA V5 (Part/ Assembly/Sheet metal/Drafting) - should have worked on 2D drafting, 3 D Modelling and have moderate to high profi\r\nSalary: Not Disclosed by Recruiter\r\nIndustry:Automobile / Auto Anciliary / Auto Components\r\nFunctional Area:Engineering Design , R&D\r\nRole Category:Engineering Design\r\nRole:Design Engineer\r\nKeyskills\r\nDesign Sheet Metal 2D Drafting Catia Part Assembly Modeling Mechanical Engineering\r\nDesired Candidate Profile\r\nEducation-\r\nUG: Any Graduate - Any Specialization, Graduation Not Required, B.Tech/B.E. - Any Specialization, Automobile, Aviation, Mechanical, Production/Industrial, Diploma - Any Specialization\r\nPG:Any Pos