n, gender identity or expression, or any other basis covered by local law\r\n\r\nQualification-Full Time Graduation\r\n\r\nhttp://careers.accenture.com/in-en/jobs/Pages/jobdetails.aspx?lang=inenClientDeliveryOperations&job=J12819',0,'N','2015-06-15 12:36:57','0000-00-00 00:00:00','Indivisual','Hr','hr@accenture.com','',0,'Y','N','2015-06-15 16:36:57','2015-06-15 16:36:57'),(46,1,11,104,1486,88074,'Ancient Engineers built Coolers ','freedgepng_11_104_1_559298275f40f.PNG,','226899,','You may think that refrigerators and freezers are inventions of the 20th century but there is historic proof that hundreds of years ago, the ancient Persians had already found a way to store ice in the middle of the dessert and in the middle of summer.\r\n\r\nWell, this so-called Yakhchal (“ice pit” in Persian) was located in underground spaces, which were used to store ice as well as some food items.\r\n\r\nSo, how did they get the ice you might ask…well, one way was to actually get ice from the icy river in the winter and store it. A more common and, also, a very smart way was to use the wall made on the north side of the yakhchal. The water channelled along the wall would freeze faster on a winter day thus producing more ice.\r\n\r\nThe ice produced and stored was kept in large underground pits with very thick walls made of a special heat and water resistant mortar. In many cases these large storage areas were provided with access to tall “wind catching” towers, which would allow cold air to enter them even in the warmest days of summer.\r\n\r\nSo making and storing ice, which we thought was a relatively recent invention, was actually first introduced as early as 400 BCE by the ancient Persians. Even today, Iranians still call the modern fridges and freezers “yakhchals”.',0,'N','2015-06-30 06:52:48','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-06-30 10:52:48','2015-06-30 10:52:48'),(47,1,11,104,1486,88074,'Gene mutation made man immune to HIV','hivpng_11_104_1_55929a923e1b4.PNG,','362328,','\r\nA German doctor became the very first person to cure HIV by using an innovative method and absolutely no anti-HIV medicines – he did it through a stem cell transplants.\r\n\r\nGero Hutter, a German hematologist born in 1968, managed to successfully cure an HIV positive patient back in 2008. Hutter’s patient, an American named Timothy Ray Brown who was residing in Berlin, Germany, was suffering from AML (acute myelogenous leukemia) and was HIV positive. Hutter used bone marrow from another person, who reportedly had a mutated CCR5 receptor (a white blood cell protein). Since the HIV attacks the immune system mostly through the CCR5, the transplanted bone marrow turned out to be magical. It not only cured Brown’s leukemia, but it also lowered his HIV levels. Brown went off his anti-HIV medications and he continued going to regular check-ups. As it turned out, his HIV levels dropped so low that nearly two years after the transplant they were already undetectable. Brown’s tests turned out negative, even though he had stopped using his drugs shortly after the transplant.\r\nHutter was praised among a list of successful Germans as one of the most notorious Berliners of 2008 for this phenomenon. In 2010 the AIDS Policy Project gave him an award for his incredible achievement.',0,'N','2015-06-30 07:03:06','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-06-30 11:03:06','2015-06-30 11:03:06'),(48,1,11,104,1486,88074,'The luckiest Man ever','frank-salakpng_11_104_1_55bc808e9e1a1.PNG,','509069,','Frank selak  an 85 year old man who narrowly survived a train crash which killed 17,being blown out of  plane which killed 19,a bus accident which killed 4, 2 car explosions, being hit by a bur,narrowly avoided a truck accident ,to go on a win a big lottery',0,'N','2015-08-01 01:47:19','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-08-01 05:47:19','2015-08-01 05:47:19'),(49,1,11,104,1486,88074,'Meet Muscle Barbie beauty with muscles','barbiejpg_11_104_1_55bcb12db0a5b.jpg,','61107,','Teenager Julia Vins has the delicate facial features of a porcelain doll - and the ripped physique of The Hulk. Julia has an army of fans in her native Russia for her unconventional combination of good looks and rippling muscles. The 18-year-old -- who likes to take topless pictures of herself -- even holds three world power-lifting records.\r\n\r\nShe said: “People know me as Muscle Barbie - I like this comparison. It’s nice.”',0,'N','2015-08-01 05:14:46','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-08-01 09:14:46','2015-08-01 09:14:46'),(50,1,11,104,1486,88074,'Kanpur: Sub-inspector sends resignation via Whatsapp - ','6-whatsappjpg_11_104_1_55bcb2faa5658.jpg,','53722,','Kanpur: In a first, a sub-inspector posted at Kanpur Dehat district has sent his resignation via Whatsapp to a helpline number started by the police for addressing the complaints by the public. Alleging harassment and insult by senior officials, sub-inspector Vinod Kumar posted at Rasulabad police station sent his resignation last night, PRO of the Kanpur Zone IG said.\r\n\r\n\"We have directed SP of Kanpur Dehat, Sabharaj to investigate the matter and submit the report within 24 hours following which action would be taken,\" IG Ashutosh Pandey said. This is the fist time that a police official has submitted his resignation through such a platform, he said. A helpline number, for the 176 police station in the nine districts of Auraiya, Etawah, Farukhabad, Kanpur, Kanpur Dehat, Kannuaj, Jhansi, Jalaun under Kanpur Zone was started on April 16 by IG Pandey. A Whatsapp account was also created for the people to register their complaints to the police through video, audio and text messages. ',0,'N','2015-08-01 05:22:27','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-08-01 09:22:27','2015-08-01 09:22:27'),(51,1,11,104,1486,88074,'Hunchbacked pooch wins World\'s Ugliest Dog contest in US dog pageant - ','hunchbagjpg_11_104_1_55bcb3aceff79.jpg,','38520,','Petaluma: A 10-year-old mutt named Quasi Modo, whose spinal birth defects left him a bit hunchbacked, is the winner of this year’s World’s Ugliest Dog contest. The pit bull-Dutch shepherd mix and his owner took the $1,500 prize on Friday night, beating 25 other dogs competing in the contest that applauds imperfection, organisers aid. \r\n\r\n\r\nAccording to his biography posted on the contest’s website, Quasi Modo was abandoned at an animal shelter before being adopted by a veterinarian in Loxahatchee, Florida. “My appearance can be a little unsettling to some (I have had grown men jump on top of their cars to get away from me because they thought I was a hyena or Tasmanian devil) but once they get to know me I win them over with my bubbly personality,” his biography said. Two Chinese crested and Chihuahua mixes named Sweepee Rambo and Frodo took the second- and third-place prizes, respectively. An eight-year-old Chihuahua named Precious received the Spirit Award, honoring a dog and owner who have overcome obstacles or are providing service to the community. Precious, who is blind in one eye, is trained to monitor smells related to low blood sugar levels and alert her owner, who is disabled, of the problem, her biography said. The contest, held at the Sonoma-Marin Fairgrounds in Petaluma, California, is in its 27th year. A three-judge panel assess the canines in several categories, including special or unusual attributes, personality and natural ugliness. - ',0,'N','2015-08-01 05:25:25','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-08-01 09:25:25','2015-08-01 09:25:25'),(52,1,11,104,1486,88074,'Check the oldest selfie in the world','09first-ever-selfiejpg_11_104_1_55bcb5bc53973.jpg,','50768,','New York: Even when there were no front-facing cameras, high mega-pixels and the craze of fake pouts, there were selfies. In 1839, 30-year-old Robert Cornelius took the world’s first self-portrait or selfie at the back of his father’s shop in Philadelphia. For this, he removed the lens cap, ran into the frame and sat still for five minutes before running back and replacing the lens cap. -\r\n\r\nSon of a Dutch immigrant, Cornelius went on to become a photographer specialising in portraits. He later returned to his father’s lamp business and managed it for 20 years. His company was touted as the largest lighting company in the US. Retired in 1877, Cornelius died in 1893. — Agencies -',0,'N','2015-08-01 05:34:13','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-08-01 09:34:13','2015-08-01 09:34:13'),(53,1,11,104,1486,88074,'That A Couple Refuses To Move Out Of Their House Even Though 11 Cars Have','26791c02-7875-4f1e-97c1-1197c3d2e17b1stphotojpg_11_104_1_55d0ac3cadf31.jpg,','46418,','The elderly couple Tim and Leigh McCall who live in a simple two-story duplex in Indianapolis, Indiana will never move out of their home. They have been living there for more than 30 years. The couple bought the house in 1979 for $4,000 and over the years they have made major renovations. It is the house where they have raised their son and all their best family memories were created.\r\n\r\nThere is no obvious reason why the McCall’s should move out except for the fact that in the period of 30 years 11 vehicles crashed and damaged their home property which might be a powerful argument for most. The latest crash occurred while the family was quietly watching a football game. Suddenly, a Chevy Equinox crashed in their house and literally destroyed their living room, missing to hit Leigh McCall by a foot.\r\n\r\nAccording to the patrol officer who investigated most of the incidents, the reason for the frequent crashes is quite obvious. There are railroad tracks nearby McCall’s home and when drivers are speeding over them they often send their vehicles in the air and once they land they lose control, often ending up directly into the McCall’s home. The best possible solution to the problem would be to simply put a stop sign before the railroad tracks.',0,'N','2015-08-16 08:59:01','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-08-16 12:59:01','2015-08-16 12:59:01'),(54,1,11,104,1486,88074,'Domino\'s unveils delivery vehicle with built-in oven','dominos-unveils-delivery-vehicle-with-built-in-ovenjpg_11_104_1_5629ea7b5e206.jpg,','23180,','ANN ARBOR, Mich., Oct. 22 (UPI) -- Pizza chain Domino\'s announced a solution to pizzas showing up cold -- a specially designed delivery vehicle with a built-in warming oven.\r\n\r\nDomino\'s said the \"Delivery ExPert,\" or DXP, is a modified version of the Chevy Spark. The automaker worked together with the eatery to develop the vehicle, which is scheduled to roll out in 25 U.S. cities within the next 90 days.\r\n\r\nThe pizza chain said the car\'s special features include an outward-facing warming oven in the back and space inside the vehicle -- which has only one seat -- for up to 80 pies.\r\n\r\n\"The Domino\'s DXP is the first purpose-built vehicle aimed at revolutionizing pizza delivery,\" said Russell Weiner, president of Domino\'s USA.  \"This innovation allows drivers to do their jobs with greater ease and efficiency, and demonstrates that Domino\'s is absolutely fanatical about making perfect deliveries.\"\r\n\r\nThe car also includes a \"puddle light\" that projects the Domino\'s logo onto the ground so drivers don\'t end up with wet shoes when they step out of their cars to deliver the piping-hot pizza pies.',0,'N','2015-10-23 01:36:20','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-10-23 05:36:20','2015-10-23 05:36:20'),(55,1,11,104,1486,88074,'This Tea Stall Owner has Traveled the World and has Great Advice for You','vijayan700x43171445422978jpg_11_104_1_5629ec372bd20.jpg,','16939,','\"I want to see this world. This is my desire, my only desire,\" says Vijayan, a tea stall owner from Kerala. He, along with his wife Mohana, has travelled to at least 17 different countries.\r\n\r\nIn a heartwarming video by Copybook Films, Vijayan talks about chasing his dream to see the world despite all odds. He talks about his wife who is the source of strength, his shop where he earns about Rs. 2000 to Rs. 3000 per day, and how society reacts to his extravagant dream, calling him crazy.\r\n\r\n\"We have one lifetime to do everything. You can\'t create extra time for it,\" he says in the video.\r\n\r\nVijayan has spent around Rs. 10-15 lakh to see the world. \"If money is our only concern, we will not be able to do anything,\" he says.\r\n\r\nHe explains how many people wonder if it would have been prudent to save the money. But Vijayan has a beautiful explanation for that as well.\r\n\r\nWatch the video below to understand Vijayan\'s perspective better. It will inspire you to go after your dream.',0,'N','2015-10-23 01:43:43','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-10-23 05:43:43','2015-10-23 05:43:43'),(56,1,11,104,1486,88074,'The women who changed her name in to full 26 English Alphabets A-Z','colombian-capital-bogota-name-change-to-abcdefg-hijklmn-opqrst-uvwxyz-woman-legally-changes-her-name-to-abcdefghijklmnopqrstuvwx-558707jpg_11_104_1_5629edca0dcc5.jpg,','43253,','The 36-year-old has been fighting red tape for over TWO years to get approval of her new name.\r\n\r\nBut now she finally has the seal of approval to call herself – Abcdefg Hijklmn Opqrst Uvwxyz.\r\n\r\nThe teacher recently changed her name to Abcdefg Hijklmn Opqrst Uvwxyz\r\nShe often changes names and was previously known as Ladyzunga Cyborg\r\nMs Uvwxyz also has passion for fetish clothes and Nazi bondage uniforms\r\nShe said she felt a need to \'redefine herself\' and bring \'element of surprise\'\r\nMs Uvwxyz teaches art and photography at three different universities\r\n\r\n',0,'N','2015-10-23 01:50:26','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-10-23 05:50:26','2015-10-23 05:50:26'),(57,1,11,104,1486,88074,'Man got 2 Robotic arms after he lost his arms in an accident','mind-control-prosthetic-limbsjpg_11_104_1_562b2a6c46c06.jpg,','97595,','Les Baugh is the first person to ever control two prosthetic limbs using only his mind.Over 40 years ago he lost both armsin an electrical accident, and now he has made history using his brain to control two robotics arms.',0,'N','2015-10-24 12:21:24','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-10-24 16:21:24','2015-10-24 16:21:24'),(58,1,11,104,1486,88074,'Good news for students..coolest way to cheat in exam','photomathjpg_11_104_1_562b3245ec961.jpg,','148334,','Programmers have developed a new cool smart phone aap called PhotoMath to solve mathematical problems..this aap can scan a question on a papper and give u the solution instantly.. ',0,'N','2015-10-24 12:54:54','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-10-24 16:54:54','2015-10-24 16:54:54'),(59,1,11,104,1486,88074,'Liger - Named as Hercules got to put it\'s as World Largest Cat in Guinness world record','liger-hercules-many-records-guinness-bookjpg_11_104_1_56332d291665d.jpg,','93030,','The liger is a hybrid cross between a male lion (Panthera leo) and a female tiger (Panthera tigris). Thus, the liger has parents of the same genus but of different species. The liger is distinct from the similar hybrid tigon. While the Siberian tiger is the largest pure sub-species, ligers are believed to be the largest of all known extant felines.\r\n\r\nLigers exist only in captivity or zoos because the habitats of the parental species do not overlap in the wild. Historically, when the Asiatic Lion was prolific, the territories of lions and tigers did overlap and there are legends of ligers existing in the wild. Although ligers share characteristics of both lions and tigers, they more closely resemble lions because of the dominant gene.Notably, ligers typically grow larger than either parent species, unlike the tigon, which tends to be about as large as a female tiger and is the cross between a male tiger and a lioness',0,'N','2015-10-30 02:11:13','0000-00-00 00:00:00','Other','','dillippradhan1988@gmail.com','9090658068',0,'Y','N','2015-10-30 06:11:13','2015-10-30 06:11:13');
